/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `disponibilidad_libro` BEFORE INSERT ON `PRESTAMOS` FOR EACH ROW BEGIN
    DECLARE contador INT;
    
    -- Verificar si el ejemplar del libro ya est prestado
    SELECT COUNT(*)
    INTO contador
    FROM PRESTAMOS
    WHERE ID_LIBRO = NEW.ID_LIBRO
    AND ID_EJEMPLAR = NEW.ID_EJEMPLAR
    AND FECHA_DEVUELTO IS NULL;

    IF contador > 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'El ejemplar del libro ya est prestado.';
    END IF;
END */;;
