/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `evitar_eliminar_prestamo` BEFORE DELETE ON `PRESTAMOS` FOR EACH ROW BEGIN
    DECLARE contador INT;
    
    -- Verificar si el libro est prestado
    SELECT COUNT(*)
    INTO contador
    FROM PRESTAMOS
    WHERE ID_LIBRO = OLD.ID_LIBRO
    AND ID_EJEMPLAR = OLD.ID_EJEMPLAR
    AND FECHA_DEVUELTO IS NULL;
    
    IF contador > 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'No se puede eliminar este registro de prstamo porque el libro est prestado.';
    END IF;
END */;;
